import React from 'react'
import TemperatureGraph from "./TemperatureGraphic/TemperatureGraph.js"
import { BasicTable } from './Table/BasicTable.js'

class Info extends React.Component {
    constructor(props){
      super(props)
    }
    render() {
        if(this.props.data.length > 2)
            return(
                <TemperatureGraph
                    cities={this.props.cities}
                    temperatures={this.props.temperatures}
                    dawn={this.props.dawn}
                    dusk={this.props.dusk}
                    color={this.props.color}
                />,
                <BasicTable
                    cities={this.props.cities}
                    temperatures={this.props.temperatures}
                    dawn={this.props.dawn}
                    dusk={this.props.dusk}
                />
            )
        else {
            return null
        }
    }
}
export default Info
